/* HELPERS */
const SYMBOLS_ARE_WEAK_REFERABLE = (() => {
    try {
        new WeakSet().add(Symbol()); //TSC
        return true;
    }
    catch {
        return false;
    }
})();
/* MAIN */
const isWeakReferable = (value) => {
    if (value === null)
        return false;
    const type = typeof value;
    return type === 'object' || type === 'function' || (SYMBOLS_ARE_WEAK_REFERABLE && type === 'symbol' && !Symbol.keyFor(value)); //TSC
};
/* EXPORT */
export default isWeakReferable;
